DROP TABLE IF EXISTS `ol_fund_earn`;
CREATE TABLE `ol_fund_earn` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `FD_NAME` varchar(100) DEFAULT NULL COMMENT '基金名称',
  `LASTEST_NET_DATA` date DEFAULT NULL COMMENT '最新净值日期',
  `TODAY_EARN_AMT` double DEFAULT NULL COMMENT '今日收益金额',
  `LASTEST_NET` double DEFAULT NULL COMMENT '最新净值',
  `LASTEST_ADD_NET` double DEFAULT NULL,
  `DAY_ADD_RATE` double DEFAULT NULL,
  `CAN_SHARE` double DEFAULT NULL COMMENT '可用份额',
  `BUY_COST` double DEFAULT NULL COMMENT '买入成本',
  `SOURCE` varchar(10) DEFAULT '1' COMMENT '来源:1-京东金融;2-支付宝;3-天天基金',
  `HOLD_AMT` double DEFAULT NULL COMMENT '持有金额',
  `HOLD_EARN_AMT` double DEFAULT NULL COMMENT '持有收益金额',
  `HOLD_EARN_RATE` double DEFAULT NULL COMMENT '持有收益率累计',
  `HOLD_EARN_RATE_DAY` double DEFAULT NULL COMMENT '持有收益率-日',
  `HOLD_EARN_RATE_MONTH` double DEFAULT NULL COMMENT '持有收益率-月',
  `HOLD_EARN_RATE_YEAR` double DEFAULT NULL COMMENT '持有收益率-年',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `remark_in` varchar(50) DEFAULT NULL COMMENT '建议买入',
  `remark_out` varchar(50) DEFAULT NULL COMMENT '建议卖出',
  `UP_MSG` varchar(255) DEFAULT NULL COMMENT '利好消息',
  `DOWN_MSG` varchar(255) DEFAULT NULL COMMENT '利空消息',
  `UP_DOWN_DAYS` varchar(255) DEFAULT NULL COMMENT '连续涨跌天数',
  `HOLD_DAYS` int(11) DEFAULT NULL COMMENT '持有天数',
  `FIRST_NET_DATA` date DEFAULT NULL COMMENT '首次净值日期',
  `TRADE_ID` varchar(100) DEFAULT NULL COMMENT '基金交易ID',
  `FD_ID` varchar(100) DEFAULT NULL COMMENT '基金ID',
  `FD_TYPE` varchar(10) DEFAULT NULL COMMENT '基金类型',
  `DATE_FLAG` varchar(255) DEFAULT NULL COMMENT '日期标志',
  `CREATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `UPDATE_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=4555 DEFAULT CHARSET=utf8 COMMENT='基金收益记录';

